class DUNSValidator:
    @staticmethod
    def validate_duns(duns_number: str) -> bool:
        """Validate DUNS number format."""
        if not duns_number or len(duns_number) != 9 or not duns_number.isdigit():
            return False
        return True

    @staticmethod
    def get_funding_agency_code(duns_number: str) -> Optional[str]:
        """Derive funding agency code from DUNS number."""
        if not DUNSValidator.validate_duns(duns_number):
            return None
        # Simple mock logic - in reality this would use a lookup table
        return f"AGENCY-{duns_number[:3]}"

