class ZipCodeValidator:
    @staticmethod
    def validate_ppop_zip(zip_code: str) -> bool:
        """Validate PPoP ZIP code format."""
        us_zip_pattern = r'^\d{5}(?:-\d{4})?$'
        return bool(re.match(us_zip_pattern, zip_code))

