class FlexFieldValidator:
    @staticmethod
    def validate_flexfield(field_name: str, value: str, max_length: int) -> Tuple[bool, str]:
        """Validate flex field content and length."""
        if not value:
            return False, "Value cannot be empty"
        if len(value) > max_length:
            return False, f"Value exceeds maximum length of {max_length}"
        if not value.isalnum():
            return False, "Value must be alphanumeric"
        return True, "Validation passed"

