class GTASAdministrator:
    @staticmethod
    def check_submission_window() -> bool:
        """Check if current time is within GTAS submission window."""
        now = datetime.now()
        # Mock window: 8AM-5PM on weekdays
        if now.weekday() >= 5:  # Weekend
            return False
        return 8 <= now.hour < 17

